import { motion } from "framer-motion";
import NextButton from "../components/NextButton";

function SectionSix({ advanceState }) {
  return (
    <div>
      <div className="w-screen text-5xl md:text-4xl -mt-12 leading-snug place-items-stretch">
        <div>
          <motion.div
            initial={{ y: "-20%", opacity: 0 }}
            animate={{ y: "0%", opacity: 1 }}
            transition={{
              ease: "easeOut",
              duration: 1,
              delay: 1,
            }}
          >
            THESE CATEGORIES,
          </motion.div>
        </div>
        <div className="flex flex-row">
          <motion.div
            initial={{ y: "-20%", opacity: 0 }}
            animate={{ y: "0%", opacity: 1 }}
            transition={{
              ease: "easeOut",
              duration: 1,
              delay: 2,
            }}
          >
            SO OBVIOUS...
          </motion.div>
          <motion.div
            initial={{ x: "15%", y: "-20%", opacity: 0 }}
            animate={{ x: "15%", y: "0%", opacity: 1 }}
            transition={{
              ease: "easeOut",
              duration: 1,
              delay: 2,
            }}
            className="italic font-serif"
          >
            {" "}
            right?
          </motion.div>
        </div>
        <div className="mx-auto">
          <NextButton advanceState={advanceState} delay={3} />
        </div>
      </div>
    </div>
  );
}

export default SectionSix;
